import { Route, Routes } from 'react-router-dom';
import Login from '../Views/login';

const Home = () => {
    return(
        <div>
            <h1>Home</h1>
        </div>
    )
}

const NotFound = () => {
    return(
        <div>
            <h1>Not Found</h1>
        </div>
    )
}


const Router = () => {


    return(
        <Routes>
            <Route path="/" element={<Login />} />
            <Route path="*" element={<NotFound />} />
        </Routes>
    )
}

export default Router
